#
# TABLE STRUCTURE FOR: Payment
#

DROP TABLE IF EXISTS `Payment`;

CREATE TABLE `Payment` (
  `citation_id` int(11) DEFAULT NULL,
  `payment` decimal(7,2) NOT NULL,
  `payment_date` datetime NOT NULL,
  `made_by` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `payment_method` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  KEY `citation_id` (`citation_id`),
  CONSTRAINT `Payment_ibfk_1` FOREIGN KEY (`citation_id`) REFERENCES `Citation` (`citation_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



